import './App.css';
import React, {useEffect, useState} from 'react';


function App() {

  const [str,setStr] = useState('');

  function buildStr(e){
    let newStr = str + e;
    setStr(newStr);
  }

  return (
    <div className="App">
      <div className="overlay">
        <div className="forerunner">
            <div className="row">
            <p className = "forerunnerText" onClick={()=>{buildStr('A')}}><span>A</span></p>
            <p className = "forerunnerText" onClick={()=>{buildStr('B')}}><span>B</span></p>
            <p className = "forerunnerText" onClick={()=>{buildStr('C')}}><span>C</span></p>
            <p className = "forerunnerText" onClick={()=>{buildStr('D')}}><span>D</span></p>
            <p className = "forerunnerText" onClick={()=>{buildStr('E')}}><span>E</span></p>
            <p className = "forerunnerText" onClick={()=>{buildStr('F')}}><span>F</span></p>
            </div>
            <p className="regular1">A B C D E F G</p>
            <h1>{str}</h1>
        </div>
        <footer>Made by Cristian Reyes</footer>
      </div>
    </div>
  );
}

export default App;
